import logo from "./logo.svg";
import "./App.css";

const URL = "ws://localhost:3030";

class App extends React.Component {
  ws = new WebSocket(URL);

  componentDidMount() {
    this.ws.onopen = () => {
      console.log("connected");
    };
  }
  render() {
    return (
      <div className="App">
        <header className="App-header"></header>
        <body>
          <h1>Twitch chat games</h1>
        </body>
      </div>
    );
  }
}

export default App;
